INSERT INTO `imp_comments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
(1, 1, 'Um comentarista do WordPress', 'wapuu@wordpress.example', 'https://wordpress.org/', '', '2020-01-15 21:38:35', '2020-01-15 23:38:35', 'Olá, isso é um comentário.\nPara começar a moderar, editar e excluir comentários, visite a tela de Comentários no painel.\nAvatares de comentaristas vêm a partir do <a href=\"https://gravatar.com\">Gravatar</a>.', 0, '1', '', '', 0, 0),
(2, 25, 'Lloyd Budd', 'foolswisdom@gmail.com', 'http://themeforest.net/item/real-homes-wordpress-real-estate-theme/5373914', '182.189.90.186', '2017-06-27 19:22:45', '2017-06-27 19:22:45', 'Podcasting operational change management inside of workflows to establish a framework. Taking seamless key performance indicators offline to maximise the long tail. Keeping your eye on the ball while performing a deep dive on the start-up mentality to derive convergence on cross-platform integration.', 0, '1', '', '', 0, 0),
(3, 25, 'Alex Shiels', 'tellyworth@gmail.com', 'http://themeforest.net/item/real-homes-wordpress-real-estate-theme/5373914', '182.189.90.186', '2017-06-28 19:24:18', '2017-06-28 19:24:18', 'Capitalize on low hanging fruit to identify a ballpark value added activity to beta test. Override the digital divide with additional clickthroughs from DevOps. Nanotechnology immersion along the information highway will close the loop on focusing solely on the bottom line.', 0, '1', '', '', 2, 0),
(4, 25, 'Alex Shiels', 'tellyworth@gmail.com', 'http://themeforest.net/item/real-homes-wordpress-real-estate-theme/5373914', '182.189.90.186', '2017-06-29 19:29:02', '2017-06-29 19:29:02', 'Bring to the table win-win survival strategies to ensure proactive domination. At the end of the day, going forward, a new normal that has evolved from generation X is on the runway heading towards a streamlined cloud solution. User generated content in real-time will have multiple touchpoints for offshoring.', 0, '1', '', '', 0, 0),
(5, 25, 'Lolyd Budd', 'foolswisdom@gmail.com', 'http://themeforest.net/item/real-homes-wordpress-real-estate-theme/5373914', '182.189.90.186', '2017-06-30 19:33:55', '2017-06-30 19:33:55', 'Leverage agile frameworks to provide a robust synopsis for high level overviews. Iterative approaches to corporate strategy foster collaborative thinking to further the overall value proposition. Organically grow the holistic world view of disruptive innovation via workplace diversity and empowerment.', 0, '1', '', '', 0, 0);
