(179, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:61:\"How to Design Your WordPress Site Using Elementor Theme Style\";s:7:\"excerpt\";s:177:\"Elementor Theme Style allows you to customize your website easily. In this tutorial, we’ll show you how to use the theme style to quickly build a unique and compelling design.\";s:7:\"created\";s:10:\"1586863421\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:148:\"https://elementor.com/blog/design-your-wordpress-site-elementor-theme-style/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:43:\"Elementor Meetups — March 2020 Highlights\";s:7:\"excerpt\";s:202:\"This last month we had to adapt our meetup planning to the COVID-19 pandemic circumstances. From mid-March, all our off-line meetups were replaced by virtual events in order to keep our community safe. \";s:7:\"created\";s:10:\"1586240820\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:128:\"https://elementor.com/blog/elementor-meetups-march-2020/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:59:\"Monday Masterclass: How to Write Great Web Design Proposals\";s:7:\"excerpt\";s:196:\"This week we’re looking at work proposals, what to consider, what to include in your price quote, and a pricing system for your services, especially if you’re building websites with Elementor.\";s:7:\"created\";s:10:\"1586158429\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:116:\"https://elementor.com/blog/website-proposal/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:45:\"6 Ways to Monetize WordPress Websites in 2020\";s:7:\"excerpt\";s:211:\"There are many methods for monetizing your WordPress site that can reinforce your business cash flow. In this article, we delve into the most effective ways to sustain your business when circumstances are shaky.\";s:7:\"created\";s:10:\"1585838838\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:118:\"https://elementor.com/blog/monetize-wordpress/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:73:\"Introducing Elementor Experts: The New Discovery Network For Web Creators\";s:7:\"excerpt\";s:232:\"We are proud to launch Elementor Experts, a brand new expert discovery network for web creators. Experts will help you showcase your best work, get hired or hire professional designers, marketers, and developers, all in one place.\r\n\";s:7:\"created\";s:10:\"1585657322\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:119:\"https://elementor.com/blog/introducing-experts/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
