(79, 1, '2017-06-02 16:13:55', '2017-06-02 16:13:55', 'Beautiful home on quiet, tree lined street. Addition and renovation create desirable layout with gracious master suite, oversized walk-in closet and lovely bathroom! Formal living room with working fireplace and French doors open to gorgeous, lushly landscaped yard. Home features formal dining room, elegant kitchen with wood beamed ceilings, bright breakfast room off family room overlooking magnificent pool and patio. Details like crown molding, coral rock wall, marble and hardwood floors, tumbled marble driveway and lovely front porch create wonderful ambiance.\n\nTransformed through a tasteful and seem-less renovation, this suite is in a concrete and steel, pet friendly, family building in a convenient downtown location. This 4 bed suite offers outstanding views of the city, ocean and mountains. Don\'t miss this opportunity This home is only accepting cash and is a short sale with limited time! The open concept plan features quartz countertops and marble backsplash, new cabinetry with eating bar and computer station and new appliances. Steps from shopping, restaurants and parks.\n\nThere is a large double car garage at the south end as well as a large workshop attached at the north which could be redeveloped into your home office or studio. New vinyl windows, vaulted ceilings showcasing the log construction, high coved ceilings, security system sound and vac roughed in and fantastic hardwoods at this price to add your own personal touches. Exceptional original construction and impossible to replace at this price.', '700 Front Street, Key West, FL', '', 'publish', 'closed', 'closed', '', '700-front-street-key-west-fl', '', '', '2017-06-02 16:13:55', '2017-06-02 16:13:55', '', 0, 'http://realhomes.inspirythemes.com/?post_type=property&amp;p=79', 0, 'property', '', 0),
