(942, 1, '2018-04-26 11:18:04', '2018-04-26 11:18:04', 'Most states require real estate sales professionals to be licensed by the state, so that they can control education and experience requirements and have a central authority to resolve consumer problems.\r\n\r\nThe terminology used to identify real estate professionals varies a little from state to state. Brokers are generally required to have more education and experience than real estate salespersons or agents.\r\n\r\nThe person you normally deal with is a real estate agent or salesperson. The salesperson is licensed by the state, but must work for a broker. All listings are placed in the broker’s name, not the salesperson’s.\r\n\r\nA broker can deal directly with home buyers and sellers, or can have a staff of salespersons or agents working for him or her.', 'What is the difference between a real estate agent and a real estate broker?', '', 'publish', 'closed', 'closed', '', 'what-is-the-difference-between-a-real-estate-agent-and-a-real-estate-broker', '', '', '2018-04-26 11:18:04', '2018-04-26 11:18:04', '', 0, 'http://classic-min.realhomes.io/?post_type=faq&amp;p=942', 0, 'faq', '', 0),
(943, 1, '2018-04-26 11:18:47', '2018-04-26 11:18:47', 'A real estate salesperson is more than just a “sales person.” They act on your behalf as your agent, providing you with advice and guidance and doing a job – helping you buy or sell a home. While it is true they get paid for what they do, so do other professions that provide advice, guidance, and have a service to sell –such as Certified Public Accountants and Attorneys\r\n\r\nThe Internet has opened up a world of information that wasn’t previously available to homebuyers and seller. The data on listings available for sale is almost current – but not quite. There are times when you need the most current information about what has sold or is for sale, and the only way to get that is with an agent.\r\n\r\nIf you’re selling a home, you gain access to the most buyers by being listed in the Multiple Listing Service. Only a licensed real estate agent who is a member of your local MLS can get you listed there – which then gets you automatically listed on some of the major real estate web sites. If you’re buying or selling a home, the MLS is your agent’s best tool.\r\n\r\nHowever, the role of an agent has changed in the last couple of years. In the past, agents were the only way home buyers and sellers could access information. Now agents are evolving. Because today’s home buyers and sellers are so much better informed than in the past, expertise and ability are becoming more important.\r\n\r\nThe real estate agent is becoming more of a “guide” than a “salesperson” — your personal representative in buying or selling a home.', 'Why should I use a real estate salesperson?', '', 'publish', 'closed', 'closed', '', 'why-should-i-use-a-real-estate-salesperson', '', '', '2018-04-26 11:18:47', '2018-04-26 11:18:47', '', 0, 'http://classic-min.realhomes.io/?post_type=faq&amp;p=943', 0, 'faq', '', 0),
(944, 1, '2018-04-26 11:20:13', '2018-04-26 11:20:13', 'You might want to consult a couple more Realtors on the market value of your home. Most of the estimates should be in the same ballpark.\r\n\r\nIt could be that your friend is being more honest with you about the value of your home and the other Realtor gave you a higher number because he already knew you expected it. This is called “Buying a Listing” and is the subject of an article on our web site.\r\n\r\nOr it could simply be that your friend is a good friend, but not that great of a real estate agent.\r\n\r\nMixing business and friendships is always risky to the friendship. On the other hand, if your friend is truly competent and was providing wise advice, she may be offended if you ignore the advice and choose another agent.', 'I have a family friend who is a Realtor. I like her and she is a help but she gives me one price to sell my home for and I think it is too low. So I called another agent who suggested a price more in line with my expectations. Who do I choose?', '', 'publish', 'closed', 'closed', '', 'i-have-a-family-friend-who-is-a-realtor-i-like-her-and-she-is-a-help-but-she-gives-me-one-price-to-sell-my-home-for-and-i-think-it-is-too-low-so-i-called-another-agent-who-suggested-a-price-more-in', '', '', '2018-04-26 11:20:13', '2018-04-26 11:20:13', '', 0, 'http://classic-min.realhomes.io/?post_type=faq&amp;p=944', 0, 'faq', '', 0),
(945, 1, '2018-04-26 11:20:46', '2018-04-26 11:20:46', 'If your goal is to buy a home for it’s resale value and the one you are thinking of buying in the older neighborhood is at the upper end of values for that neighborhood, then it may not be the wisest choice. If it is similar or lower in price to the others, then there should be no problem, because pricing should be considered in relation to the local neighborhood and not compared to homes in other neighborhoods (for the most part)\r\n\r\nPlus, is it a neighborhood on the decline, or are others going to be fixing things up, too, so that it is a neighborhood that is improving? It could turn out to be a very good deal as long as you don’t “overpay” because of the recent improvements.\r\n\r\nRemember that you also buy a home for it’s value to you as a “home,” and that is something else you should consider. Which neighborhood would you AND your family feel most comfortable in?', 'I have to make a choice between an updated home in an older neighborhood or a newer home in a more modern neighborhood. The home in the older neighborhood has almost everything I want and is much larger, but which makes the most sense as an investment?', '', 'publish', 'closed', 'closed', '', 'i-have-to-make-a-choice-between-an-updated-home-in-an-older-neighborhood-or-a-newer-home-in-a-more-modern-neighborhood-the-home-in-the-older-neighborhood-has-almost-everything-i-want-and-is-much-larg', '', '', '2018-04-26 11:20:46', '2018-04-26 11:20:46', '', 0, 'http://classic-min.realhomes.io/?post_type=faq&amp;p=945', 0, 'faq', '', 0),
(946, 1, '2018-04-26 11:21:05', '2018-04-26 11:21:05', 'A lot depends on why you are buying the house. Are you buying it mostly as a home or mostly as an investment? There is a difference.\r\n\r\nFor the most part, upgrades are high-profit items for builders. They aren’t designed to enhance the value of the house, but make you happier with the house you do buy.\r\n\r\nIf you are looking at your home as an investment, then you buy from the smaller to medium size in the tract and spend only a minimal amount on upgrades. If you are looking at your purchase as a home, then you select upgrades that will enhance your quality of living.\r\n\r\nOne rule of thumb is to always upgrade the carpet and padding.', 'When buying a new home, what upgrades should we go for? What holds the most value? Do we upgrade the lot? Pick more square footage in the house? Add an extra bedroom?, etc.', '', 'publish', 'closed', 'closed', '', 'when-buying-a-new-home-what-upgrades-should-we-go-for-what-holds-the-most-value-do-we-upgrade-the-lot-pick-more-square-footage-in-the-house-add-an-extra-bedroom-etc', '', '', '2018-04-26 11:21:05', '2018-04-26 11:21:05', '', 0, 'http://classic-min.realhomes.io/?post_type=faq&amp;p=946', 0, 'faq', '', 0),
