(954, 1, '2018-04-26 11:40:23', '2018-04-26 11:40:23', 'We have been extremely pleased with your attentiveness, communication, honesty and advice throughout the entire process. Selling a house is a stressful occurrence for anyone and you have helped to make it as smooth as possible for us. We feel that you truly go beyond the general duties of a real estate agent with thorough follow ups, reporting and always being ‘on top’ of potential buyers.', 'Andrew David', '', 'publish', 'closed', 'closed', '', 'andrew-david', '', '', '2018-04-26 11:40:23', '2018-04-26 11:40:23', '', 0, 'http://classic-min.realhomes.io/?post_type=testimonial&amp;p=954', 0, 'testimonial', '', 0),
(955, 1, '2018-04-26 11:41:56', '2018-04-26 11:41:56', 'We had our home on the market with Real Homes and after only 3 viewings the house was SOLD!! And we got the price we wanted. When selling a house it comes down to the owner being given a realistic valuation, and ensuring the agent you choose knows their stuff. My advice to anyone considering selling your home is that they must feel comfortable with their agent choice. My wife and I would have no hesitation in recommending Real Homes to anyone in the future who is trying to decide between agents.', 'Mike Robert', '', 'publish', 'closed', 'closed', '', 'mike-robert', '', '', '2018-04-26 11:41:56', '2018-04-26 11:41:56', '', 0, 'http://classic-min.realhomes.io/?post_type=testimonial&amp;p=955', 0, 'testimonial', '', 0),
