(959, 1, '2018-04-26 11:59:01', '2018-04-26 11:59:01', 'Capitalize on low hanging fruit to identify a ballpark value added activity to beta test. Override the digital divide with additional clickthroughs from DevOps. Nanotechnology immersion along the information highway will close the loop on focusing solely on the bottom line.\r\n\r\nPodcasting operational change management inside of workflows to establish a framework. Taking seamless key performance indicators offline to maximise the long tail. Keeping your eye on the ball while performing a deep dive on the start-up mentality to derive convergence on cross-platform integration.', 'James Estate Agents', '', 'publish', 'closed', 'closed', '', 'james-estate-agents', '', '', '2018-04-26 11:59:01', '2018-04-26 11:59:01', '', 0, 'http://classic-min.realhomes.io/?post_type=agency&amp;p=959', 0, 'agency', '', 0),
(961, 1, '2018-04-26 12:00:11', '2018-04-26 12:00:11', 'Alice is a broker associate and Realtor. She is dedicated in helping buyers and sellers throughout the city. She enjoys the local aspect of real estate, spending time discovering and sharing the city community with her clients, including parks, neighbourhoods, changing trends and resources like restaurants and music venues.\r\n\r\nShe has served as her building’s board president for the past two years. She is also active in the community as a volunteer and donor for Children’s Services. Her designations include Certified International Property Specialist and membership of the International Real Estate Federation. Clients are impressed by her tireless work, negotiation skills, and business sense. They appreciate her communication skills, knowledge and ability to help them meet their real estate goals.', 'Alice Estate Agency', '', 'publish', 'closed', 'closed', '', 'alice-estate-agency', '', '', '2018-04-26 12:00:11', '2018-04-26 12:00:11', '', 0, 'http://classic-min.realhomes.io/?post_type=agency&amp;p=961', 0, 'agency', '', 0),
